defs.script:
var svgRoot=document.getElementsByTagName('svg')[0];var cursorTimer;document.addEventListener('mousemove', function(e){e.preventDefault();e.stopPropagation();if(e.target!=svgRoot){e.target.style.cursor='inherit';}
svgRoot.style.cursor='url(data:image/png;base64,), auto';
if(e.target.tagName.toLowerCase()==='image') e.target.style.cursor=svgRoot.style.cursor;try{clearTimeout(cursorTimer);}catch(err){};cursorTimer=setTimeout(function(){e.target.style.cursor='none';},3000);});document.addEventListener('keydown',function(e){if(e.key=='PageDown'||e.key=='ArrowDown'||e.key=='ArrowRight')document.location.replace('talk-04.svg');if(e.key=='PageUp'||e.key=='ArrowUp'||e.key=='ArrowLeft')document.location.replace('talk-02.svg');if(e.key=='Home') document.location.replace('talk-01.svg');if(e.key=='End') document.location.replace('talk-15.svg');});function randomMove(tg,s) { let dx=-s+Math.floor(Math.random()*2*s+1); let dy=Math.floor(Math.sqrt(s*s-dx*dx))*(Math.random()<0.5?-1:1); let x,y;x=y=0; if(tg.getAttribute('transform')) { [,x,y]=tg.getAttribute('transform').match(/translate.([^,]+),([^)]+)./); x=Number(x);y=Number(y); } x+=dx;y+=dy; tg.setAttribute('transform','translate('+x+','+y+')'); }
